import React,{ useState } from "react";
import {Button, Link, DialogTitle, Dialog, DialogActions, DialogContent, DialogContentText} from '@material-ui/core/';


export default function Modal() {
  const [open, setOpen] = React.useState(false);
  const [currPwd, setcurrPwd] = useState("");
  const [newPwd, setnewPwd] = useState("");
  const [verifyPwd, setverifyPwd] = useState("");
  const [showVal, setshowVal] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const toggleShow = (event) => {
    event.preventDefault()
    setshowVal(!showVal)
    console.log(setshowVal)
  }

  return (
    <div>
        <div className="pwdLink">
            <Link onClick={handleClickOpen}>Change Password</Link>
        </div>
      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">
          {"Change Password"}
        </DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
          <form>
      <label>
        <p>Verify Password</p>
        <input
          type="password"
          value={currPwd}
          onChange={e => setcurrPwd(e.target.value)}
        />
      </label>
      <label>
        <p>New Password</p>
        <input
          type="password"
          value={newPwd}
          onChange={e => setnewPwd(e.target.value)}
        />
      </label>
      <button onClick={toggleShow}>Show / Hide</button>
      <label>
        <p>Current Password</p>
        <input
            type={showVal ? "password" : "text"}
            value={verifyPwd}
            onChange={e => setverifyPwd(e.target.value)}
        />
      </label>
      <button onClick={toggleShow}>Show / Hide</button>
    </form>
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Disagree
          </Button>
          <Button onClick={handleClose} color="primary" autoFocus>
            Agree
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
